import React from "react";
import styled from "styled-components";

function Nav() {
  return (
    <React.Fragment>
      <NavContainer>
        <LogoContainer>
          <h1>React Meals</h1>
        </LogoContainer>
        <MenuItemsContainer>
          <nav>
            <ul>
              <li>Item 1</li>
              <li>Item 2</li>
            </ul>
            <button>Cart</button>
          </nav>
        </MenuItemsContainer>
      </NavContainer>
    </React.Fragment>
  );
}

export default Nav;

const NavContainer = styled.div`
  display: flex;
  align-items: center;
  width: 100%;
  height: 10vh;
`;

const LogoContainer = styled.div`
  color: white;
  width: 40%;
  text-align: center;
`;

const MenuItemsContainer = styled.div`
  width: 50%;
  background: blue;
  nav {
    display: flex;
    justify-content: flex-end;
    ul {
      display: flex;
      justify-content: space-between;
      align-items: flex-end;
      flex-wrap: wrap;
      color: white;
      list-style: none;

      li {
        text-align: center;
        padding: 1rem;
      }
    }
  }
`;
